import React from 'react';
import './_Footer.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { library } from '@fortawesome/fontawesome-svg-core';
import { fab } from '@fortawesome/free-brands-svg-icons';
import { faPhoneAlt } from "@fortawesome/free-solid-svg-icons";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { faMapMarkerAlt } from "@fortawesome/free-solid-svg-icons";

library.add(fab);

const Footer = () => {
    return (

    <> 
        <footer className="footer">
            <h2 className="footer__heading">Get In Touch</h2>
            <div className="footer__socials">
                <a className="footer__socials--icon" href="https://www.linkedin.com/in/thomas-mckyer/"><span className="label">LinkedIn</span><FontAwesomeIcon icon={['fab' , 'linkedin']} /></a>
                <a className="contact--icon divider" href="https://www.instagram.com/tmckyer/"><span className="label">Instagram</span><FontAwesomeIcon icon={['fab' , 'instagram']} /></a>
                <a className="contact--icon" href="https://github.com/tivler"><span className="label">Github</span><FontAwesomeIcon icon={['fab' , 'github-square']} /></a>
            </div>

            <nav className="footer__nav">
                <div className="footer__info">
                    <a className="footer__info--icon" href="https://www.linkedin.com/in/thomas-mckyer/"><FontAwesomeIcon className="footer--icon" icon={faPhoneAlt} /><span className="label">(704) 808 8000</span></a>
                    <a className="footer__info--icon divider" href="https://www.instagram.com/tmckyer/"><FontAwesomeIcon className="footer--icon" icon={faEnvelope} /><span className="label">information@slotify.io</span></a>
                    <a className="footer__info--icon" href="https://github.com/tivler"><FontAwesomeIcon className="footer--icon" icon={faMapMarkerAlt} /><span className="label">123 Somewhere Lit Drive, Charlotte, NC 28277</span></a>
                </div>
            </nav>

            <div className="copyright">
                <p className="copyright__text">Copyright &copy; 2019 Slotify.io</p>
            </div>
        </footer>
    </>

    )
}

export default Footer;
